  return (
    <div className='wrapper'>
      <h1>Mind Teams</h1>
      <Router>
        <Routes>
          <Route path="/" exact element={ <Dashboard/> } />
          <Route path="/dashboard" element={ <Dashboard/> } />
        </Routes>      
      </Router>
    </div>
  );
}

export default App;
